import React from 'react';
import {View, Text, StyleSheet} from 'react-native';
const Vegan = () => {
  return (
    <View style={styles.container}>
      <Text>Vegan</Text>
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});
export default Vegan;
